// ResultPage.js
import React from 'react';
import { useLocation } from 'react-router-dom';

const Result = () => {
  const location = useLocation();
  const { state } = location;

  return (
    <div>
      <h2>Loan Prediction Results</h2>
      {state && state.Eligibility === 0 ? (
        <p>You are not eligible for the loan.</p>
      ) : (
        <div>
          <p>Eligibility: {state.Eligibility}</p>
          <p>Requested Loan Amount: {state.Requested_Loan_Amount}</p>
          <p>Preferred Repayment Period: {state.Preferred_Repayment_Period}</p>
          <p>EMI: {state.EMI}</p>
          <p>Risk Score: {state.Risk_Score}</p>
        </div>
      )}
    </div>
  );
};

export default Result;
